import React from 'react';
import UniverseMap from './components/UniverseMap';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        <div className="icon-placeholder"></div>
        <h1>Taiyi's Prosperous Universe Map</h1>
      </header>
      <UniverseMap />
    </div>
  );
};

export default App;
